-- Volcando estructura para procedimiento lifecoin.usp_codigo_generar
DELIMITER //
CREATE PROCEDURE `usp_codigo_generar`()
BEGIN
DECLARE cantidad INT;
DECLARE val_compra INT;
DECLARE val_producto INT;
DECLARE val_count INT;


DECLARE listaCompra CURSOR FOR SELECT ncantidad,ncodproducto,ncodcompra FROM compra_detalle WHERE ncodcompra > 1;
SELECT count(*) into val_count from compra_detalle WHERE ncodcompra > 1;
	OPEN listaCompra;
			my_cur_loop: LOOP 
			FETCH listaCompra INTO cantidad,val_producto,val_compra;
			
				WHILE cantidad > 0 DO
						 cvalorcodigo,
						 nestado,
						 ncodcompra)
						 VALUES
						 (val_producto,
						 LPAD(CAST(CONCAT(CAST(val_compra AS VARCHAR(50)),CAST(val_producto AS VARCHAR(50)),CAST(cantidad AS VARCHAR(50))) AS VARCHAR(50)),12,'0'),
						 1,
						 val_compra);
		    		SET cantidad = cantidad - 1;
		  		END WHILE;
		  		SET val_count = val_count - 1;
			    IF val_count = 0 THEN
			            LEAVE my_cur_loop;
			    END IF;
			END LOOP my_cur_loop;
	CLOSE listaCompra;
END//
DELIMITER ;

